import './IconFirefox.css';
import logoFirefox from './logoFirefox.svg';

export const IconFirefox = () => {
    return (
        <>
        <div className='logo-container'>
            <img className='logo-firefox' src={logoFirefox} alt='' />
        </div>
        </>
    );

};
